import React from 'react';
import './stocks_cards.css';

const StockCard = ({ stock }) => {
  return (
    <div className="stock-card">
      <h2>{stock.symbol}</h2>
      <p>{stock.name}</p>
      <p>Price: {stock.price}</p>
      <p>Change: {stock.change}</p>
    </div>
  );
};

export default StockCard;
